import React from 'react';

import './App.css';

function App() {
  return (
    <div className="container">
      <header>
        <h1>devin poore portfolio</h1>
      </header>

      <div className="row">

        <div id="projectButtons" className="col-md-2">
           <button className="btn btn-lg">artwave</button>
           <button className="btn btn-lg">artwave 2.0</button>
           <button className="btn btn-lg">carpoolify</button>
           <button className="btn btn-lg">carpoolify 2.0</button>
           <button className="btn btn-lg">spawtted</button>
           <button className="btn btn-lg">chorechat</button>
        </div>

        {/* This should be a ternary depending on whether the sidebar 'about' is showing */}
        <div id="projectDesc" className="col-6-md">
          <h2>Selected project description</h2>
        </div>

        <div id="about" className="col-md-4">
          <h2>About Section</h2>
        </div>

      </div>

    </div>
  );
}

export default App;
